use grad_db;
-- Delete existing records from Graduate table
DELETE FROM grad_db.ContactInfo;
DROP TEMPORARY TABLE IF EXISTS temp_ContactInfo;

CREATE TEMPORARY TABLE temp_ContactInfo AS
SELECT * FROM grad_db.ContactInfo;


address,
personal_EmailAddress,
edu_EmailAddress,
first_Phone,
second_Phone,
idGraduate)
SELECT 
tci.address,
tci.personal_EmailAddress,
tci.edu_EmailAddress,
tci.first_Phone,
tci.second_Phone,
i.idGraduate
FROM temp_ContactInfo as tci
JOIN (SELECT ROW_NUMBER() OVER (ORDER BY idGraduate) AS rowid, idGraduate
		FROM grad_db.graduate) as i ON i.rowid = tci.idGraduate

